["def rdp_trace(n: int, i: int) -> list:

	def loop(n: int, i: int) -> list:
		if n == 1:
			return []
		if i <= n // 2:
			rval = loop(n // 2, n // 2 - i + 1)
			rval.append(i)
			return rval
		else:
			rval = loop(n // 2, i - n // 2)
			rval.append(i)
			return rval
	return loop(2 ** n, i)

